import React, { Component } from 'react'
import '../styles/colorComponent.css';

export class ListOfAddedColor extends Component {
  constructor(props) {
    super(props);

  }
  render() {
     return this.props.listOFColor.map((data) => (
         <div  key ={data.id}  className="main_color" style={{backgroundColor:data.name}} onClick={this.props.onDeleteColor.bind}>{data.name}</div>
    )) 


  }
}

export default ListOfAddedColor
